import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import React, { useState } from 'react';
import './Login.scss';
import SignUp from './SignUp'
import SignIn from './SignIn'
import { setLogin } from '../../store/actions/home'
import { connect } from "react-redux";

const useStyles = makeStyles({
  root: {
    flexGrow: 1,
  },
});



const Login = (props) => {

  const classes = useStyles();
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const [show, setShow] = useState(<SignIn />);

  const signInShow = (e) => {
    setShow(<SignIn />);
  }
  const signUpShow = (e) => {
    setShow(<SignUp />);
  }
  const click = (e) => {
    e.stopPropagation();
  }
  return (
    <center>
      <div id="myModal" className="modal_login glass_login" onClick={() => props.setLogin(false)} >

    {/* <Paper className={classes.root}> */}
    <Tabs
      value={value}
      onChange={handleChange}
      indicatorColor="red"
      textColor="primary"
      centered
    >
      <Tab label="Item One" />
      <Tab label="Item Two" />
      <Tab label="Item Three" />
    </Tabs>
  {/* </Paper> */}

        <div className="modal-content_login" onClick={click}>
          <div id="btn_signin" onClick={signInShow} >SIGN IN</div>
          <div id="btn_signup" onClick={signUpShow}>SIGN UP</div>
          <div id="login_top" >
            {show}
          </div>
          <div id="login_bottom"></div>
          {/* REGISTER */}
        </div>
      </div>
    </center>
  );
}

const mapStateToProps = (state) => {
  return {

  };
}
export default connect(mapStateToProps, { setLogin })(Login);
